		"ProductReview": "\n                    \n                        \uc5b4\ubc18\uc0ac\uc774\ub4dc New Protect 3+ \ucea0\ud551\ub3c4\ud0b9 suv \ucc28\ubc15\ud150\ud2b8\uc258\ud130\ub97c \uc124\uce58 \uc2dc\uc791\ud588\ub294\ub370\uc694.\n\n8.3kg\uc758 \uac00\ubcbc\uc6b4 \ubb34\uac8c\ub77c \ubd80\ubd80 \ub458\uc774\uc11c \uc124\uce58\ud558\ub294 \ub370\uc5d0 \uc804\ud600 \uc5b4\ub824\uc6c0\uc774 \uc5c6\uc5c8\ub124\uc694. 8\uac1c\uc758 \uace0\ud004\ub9ac\ud2f0 \ud329\uc740 \uac10\ud0c4\uc744 \uc790\uc544\ub0b4\ub354\uad70\uc694.\n\n\ud3f4\ub300 3\uac1c\ub85c 10\ubd84\ub3c4 \ucc44 \uac78\ub9ac\uc9c0 \uc54a\uc544 \uc644\uc131\uc744 \ud588\uc5b4\uc694. \uc2ac\ub9ac\ube0c \uc774\uc6a9\ub3c4 \ubd80\ub4dc\ub7fd\uc2b5\ub2c8\ub2e4.\n\n\ubc14\ub2e5\uc774 \uc77c\uccb4\ud615\uc73c\ub85c \ub9cc\ub4e4\uc5b4\uc838\n\n\ucc28\ub85c \ud655\uc7a5\ub418\ub294 \uacf5\uac04\uc744 \ub354\uc6b1 \ub113\ud78c New Protect 3+ \ucea0\ud551\ub3c4\ud0b9 suv \ucc28\ubc15\ud150\ud2b8\uc258\ud130.\n\n120g PE \ubc14\ub2e5\uc7ac \uc77c\uccb4\ud615 \uc124\uacc4\ub85c \ud574\ucda9\uacfc \ubc14\ub2e5\uc758 \ub0c9, \uc2b5\uae30\ub85c\ubd80\ud130 \uc548\uc804\ud558\ub2c8\n\n\ub9e4\ud2b8\ub9cc \uac04\ub2e8\ud788 \uae54\uc544\uc8fc\uba74 \ud3b8\uc548\ud558\uac8c \uacf5\uac04 \ud65c\uc6a9\uc774 \uac00\ub2a5\ud569\ub2c8\ub2e4.\n\n\uc2e4\uc81c\ub85c 2\ubc15\uc744 \ud558\uba74\uc11c\ub3c4 \ub0b4\ub9c8\ubaa8\uc131\uc774 \ub6f0\uc5b4\ub098\uace0 \uad6c\uba4d\uc5d0 \uac15\ud55c \ubc14\ub2e5\uc7ac \ubc29\uc218 \uc2dc\ud2b8 \ub355\ubd84\uc5d0, \ubc14\ub2e5\uc758 \ub0c9\uae30\ub098 \uc2b5\uae30\uac00 \ub290\uaef4\uc9c0\uc9c0 \uc54a\uc558\ub124\uc694.\n\n\n3\uba74 \ubb38 \uac1c\ubc29\uc774 \uac00\ub2a5\ud558\ub2c8 \ub354\uc6b1 \ub113\uc740 \uac1c\ubc29\uac10\uc744 \ub290\ub084 \uc218 \uc788\uc5c8\uc5b4\uc694.\n\n\ubc29\ucda9\ub9dd\uc744 \ud1b5\ud574 \uc2dc\uc6d0\ud55c \ubc14\ub78c\uc740 \ud1b5\ud558\uace0,\n\n\ud734\uc2dd\ud560 \ub54c\ub098 \uc7a0\uc798 \ub54c\ub294 3\uba74\uc744 \ubaa8\ub450 \ub2eb\uc544\uc8fc\uba74 \uc544\ub291\ud569\ub2c8\ub2e4.\n\n\n\uc2a4\ud2b8\ub7a9 \uc5ed\uc2dc \ud2bc\ud2bc\ud574\uc11c \ub9c8\uc74c \ub193\uace0 \uc124\uce58\ud560 \uc218 \uc788\uc5c8\uc5b4\uc694. \ub9e4\uc26c\ucc3d\uc740 \ub113\uace0 \ucd18\ucd18\ud574\uc11c \ubc8c\ub808\uac00 \uc798 \ucc28\ub2e8\ub418\uace0 \uacf5\uae30\ub3c4 \uc798 \ud1b5\ud574\uc694.\n\n\n\ucc28\ubc15\uc758 \ubc14\uafc0 \uc218 \uc5c6\ub294 \uc7a5\uc810\uc774\ub77c\uba74 \ucc28\uac00 \uac00\uc9c4 \uae30\ub2a5\uc744 \ubaa8\ub450 \uc774\uc6a9\ud558\uba74\uc11c, \uc124\uce58 \ubc0f \uc815\ub9ac \uc218\ub0a9\uc774 \ub354\uc6b1 \uac04\ud3b8\ud558\ub2e4\ub294 \uac83\uc774\uaca0\uc8e0.\n\nNew Protect 3+ \ucea0\ud551\ub3c4\ud0b9 suv \ucc28\ubc15\ud150\ud2b8\uc258\ud130\uc640 \ud568\uaed8\ub77c\uba74 \uadf8 \uc544\ub291\ud568\uc774 \ubc30\uac00 \ub420 \uac83 \uac19\ub124\uc694.\n\n\n\ubc29\uc218\uc640 \ub0c9\uae30, \uc2b5\uae30 \ucc28\ub2e8\uc740\n\n\uc774\ubc88 \uc5b4\ubc18\uc0ac\uc774\ub4dc New Protect 3+ \ucea0\ud551\ub3c4\ud0b9 suv \ucc28\ubc15\ud150\ud2b8\uc258\ud130\uc758 \uac00\uc7a5 \ud070 \uc7a5\uc810\uc774 \uc544\ub2d0\uae4c\uc694.\n\n\uac00\ub85c 3.65m, \uc138\ub85c 2.3m\uc5d0\n\n\ub192\uc774 \uc5ed\uc2dc 2.1m\ub85c \ub109\ub109\ud55c \ub0b4\ubd80 \uba74\uc801\uc5ed\uc2dc \ud2b9\uc7a5\uc810\uc774\ub77c\uace0 \ubcf4\uc5ec\uc9d1\ub2c8\ub2e4.\n\n\uc131\uc778 2\uba85, \uccad\uc18c\ub144 2\uba85 4\uc778 \uac00\uc871\uc774 2\ubc15\uc744 \ud558\uba70 \ucf8c\uc801\ud558\uac8c \uc0dd\ud65c\ud560 \uc218 \uc788\uc5c8\uc73c\ub2c8\uae4c\uc694. \uc131\uc778 \ub0a8\uc131 4\uc778\ub3c4 \uc5ec\uc720\uc788\uc744 \uacf5\uac04\uc774\ub77c\uace0 \uc0dd\uac01\ub418\ub124\uc694.\n\n\ucc28\ubc15\uc758 \uc0c8\ub85c\uc6b4 \ud655\uc7a5\uc131\uc744 \ubcf4\uc5ec\uc900 \ud150\ud2b8\uc258\ud130\ub77c\uace0 \ubd88\ub9b4\ub9cc \ud55c \uac83 \uac19\uc544\uc694. \ub2e4\ub9cc, \uc6b0\ucc9c\uc2dc \uc9c0\ud37c \ubd80\ubd84\uc73c\ub85c \ub204\uc218\uac00 \uc788\uc2b5\ub2c8\ub2e4. \ube44\uac00 \uc608\uc0c1\ub420\ub54c\ub294 \ubc18\ub4dc\uc2dc \ud150\ud2b8 \uc704\ub85c \ucd94\uac00 \ud50c\ub77c\uc774\ub97c \uccd0\uc57c \ud560 \uac83 \uac19\uc544\uc694.\n\n\uc55e\uc73c\ub85c\uc758 \uac00\uc744, \uaca8\uc6b8\ub3c4 \uc5b4\ubc18\uc0ac\uc774\ub4dc New Protect 3+ \ucea0\ud551\ub3c4\ud0b9 suv \ucc28\ubc15\ud150\ud2b8\uc258\ud130\uc640 \ud568\uaed8\ud560 \uac00\uc871 \ucc28\ubc15\uc774 \ub354\uc6b1 \uae30\ub300\ub429\ub2c8\ub2e4.\n                    \n                ",
